const api = 'https://us-central1-js-capstone-backend.cloudfunctions.net/api/games/';
const player = document.querySelector('.name');
const score = document.querySelector('.score');
const submitButton = document.querySelector('.submit');
const scoreList = document.querySelector('.score_list');
const refreshButton = document.querySelector('.refresh');
const gameId = localStorage.getItem('score');
const notificationMsg = document.getElementById('notify');

const hide = () => {
  notificationMsg.classList.remove('active');
  notificationMsg.classList.remove('empty');
};

const gameName = async (gameId) => {
  let response = await fetch (api, {
    method: 'POST',
    body: JSON.stringify({name: "Davis's Game"}),
    headers: {
      'content-type': 'application/json; charset= UTF-8',
    }
  });
  response = await response.json();
  gameId = await response.result.split(' ')[3];
  localStorage.setItem('scores',gameId);
  window.location.reload();
};

const submission = async (player, score, gameId) => {
  if(player.value !== '' && score.value !== '' && isNaN(score.value)===false) {
    await fetch(`https://us-central1-js-capstone-backend.cloudfunctions.net/api/games/${gameId}/scores`, {
      method:'POST',
      body: JSON.stringify({
        user:`${player.value}:`,
        score:`${score.value}`,
      }),
      headers: {
        'content-type': 'application/json; charset= UTF-8',
      },
    });
    notificationMsg.textContent = 'scores added';
    notificationMsg.classList.add('active');
    player.value = '';
    score.value = '';
    setTimeout(hide,2000);
  } else {
    notificationMsg.textContent = 'Inputs cannot be empty,score must be a number';
    notificationMsg.classList.add('empty');
    setTimeout(hide, 2000);
  }
};

const refreshing = async (gameId, scoreList) => {
  notificationMsg.textContent = 'retriving data from API';
  notificationMsg.classList.add('active');
  setTimeout(hide,2000);
  scoreList.innerHTML = '';
  let response = await fetch(`https://us-central1-js-capstone-backend.cloudfunctions.net/api/games/${gameId}/scores`, {
    method:'GET',
    headers:{
      'content-type': 'application/json; charset= UTF-8',
    },
  });
  response = await response.json();
  response = response.result.sort((a,b) => {return b.score -a.score})
  response.forEach((element) => {
    scoreList.innerHTML += `<li class='scores_li'>${element.user} ${element.score}</li>`;
  });
};

